import React from 'react';
import { NoteType } from '../types/notesTypes';
import { extractDatesMentioned } from '../utils/utilsData';
import NoteItemCell from './NoteItemCell';
import { isBig } from '../utils/otherUtils';
import ButtonDiv from './UI/ButtonDiv/ButtonDiv';

interface NoteItemProps {
  note: NoteType,
  typeTable: string,
}

const NoteItem: React.FC<NoteItemProps> = ({
  note,
  typeTable

}) => {

  const datesMentioned = extractDatesMentioned(note.content);

  const cells = [note.createdTime, note.content, note.category, datesMentioned.join(', '),];

  return (
    <div className='notesTableRow blueRow'>
        {cells.map((cell, index) => <NoteItemCell isBig = {isBig(index)}>{cell}</NoteItemCell>)}
        <ButtonDiv/>
    </div>
  );
}
  
  
export default NoteItem;
